import React, { Component } from 'react';

export default class Header extends Component {
    render(){

      function handleClick(e) {
        e.preventDefault();
        console.log('The link was clicked.');
        window.alert("Link was clicked");
      }
  return (
   /* <div className="Header">
        <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#about" onClick={handleClick}>About</a></li>
            <li><a className ="active2" href="#register">Register</a></li>
            <li><a className="active" href="#login">Log in</a></li>
        </ul>
    </div>*/
    <div className="Header">
    <ul>
        <li><button className="active" onClick={handleClick}>About </button></li>
        <li><button className="active" onClick={handleClick}>Log in </button></li>
        <li><button className="active" onClick={handleClick}>Register</button></li>
        <li><button className="active" onClick={handleClick}>Home</button></li>

    </ul>
</div>
  );
    }
}
